import React from 'react';
import { Container, Typography, Grid, Card, CardContent, Button, Box } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  const services = [
    {
      title: 'Chatbots',
      description: 'Desenvolvimento de chatbots inteligentes para atendimento ao cliente, vendas e suporte.',
      icon: 'ü§ñ'
    },
    {
      title: 'Automa√ß√µes',
      description: 'Automa√ß√£o de processos repetitivos para aumentar a produtividade da sua empresa.',
      icon: '‚ö°'
    },
    {
      title: 'APIs',
      description: 'Desenvolvimento de APIs personalizadas para integra√ß√£o de sistemas e servi√ßos.',
      icon: 'üîå'
    }
  ];

  return (
    <Box>
      {/* Hero Section */}
      <Box
        sx={{
          bgcolor: 'primary.main',
          color: 'white',
          py: 8,
          mb: 6
        }}
      >
        <Container>
          <Typography variant="h2" component="h1" gutterBottom>
            Solu√ß√µes Python para sua Empresa
          </Typography>
          <Typography variant="h5" sx={{ mb: 4 }}>
            Automatize processos, crie chatbots inteligentes e desenvolva APIs personalizadas
          </Typography>
          <Button
            variant="contained"
            color="secondary"
            size="large"
            onClick={() => navigate('/plans')}
          >
            Ver Planos
          </Button>
        </Container>
      </Box>

      {/* Services Section */}
      <Container sx={{ mb: 8 }}>
        <Typography variant="h3" component="h2" align="center" gutterBottom>
          Nossos Servi√ßos
        </Typography>
        <Grid container spacing={4} sx={{ mt: 2 }}>
          {services.map((service) => (
            <Grid item key={service.title} xs={12} md={4}>
              <Card sx={{ height: '100%' }}>
                <CardContent>
                  <Typography variant="h1" align="center" gutterBottom>
                    {service.icon}
                  </Typography>
                  <Typography variant="h5" component="h3" gutterBottom>
                    {service.title}
                  </Typography>
                  <Typography variant="body1" color="text.secondary">
                    {service.description}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>

      {/* CTA Section */}
      <Box sx={{ bgcolor: 'grey.100', py: 8 }}>
        <Container>
          <Typography variant="h4" component="h2" align="center" gutterBottom>
            Pronto para come√ßar?
          </Typography>
          <Typography variant="body1" align="center" sx={{ mb: 4 }}>
            Escolha o plano ideal para sua empresa e comece a transformar seus processos hoje mesmo.
          </Typography>
          <Box sx={{ display: 'flex', justifyContent: 'center' }}>
            <Button
              variant="contained"
              color="primary"
              size="large"
              onClick={() => navigate('/plans')}
            >
              Ver Planos e Pre√ßos
            </Button>
          </Box>
        </Container>
      </Box>
    </Box>
  );
}

export default Home;
